(6, '17096351', '1234003', 'Phản hồi điểm danh sai ngày 2019-09-09', 'Thưa thầy, ngày 2019-09-09 em vắng có phép và đã đưa đơn xin phép cho thầy vào tuần trước đó. Nhưng trên hệ th lại báo vắng không phép. Mong thầy kiểm tra lại giúp em. Em cảm ơn.', '1230041', '2020-03-24'),
(7, '17064161', '1234003', 'Phản hồi điểm danh sai ngày 2019-10-21', 'Thưa thầy, ngày 2019-10-21 em vắng có phép và đã đưa đơn xin phép cho thầy vào tuần trước đó. Nhưng trên hệ th lại báo vắng không phép. Mong thầy kiểm tra lại giúp em. Em cảm ơn.\r\n', '1230041', '2020-03-24'),
(8, '17084001', '1234004', 'Phản hồi điểm danh sai ngày  2019-09-30', 'Thưa thầy, ngày 2019-09-30 em chỉ đi trễ. Nhưng trên hệ thống lại báo vắng không phép. Mong thầy kiểm tra lại giúp em. Em cảm ơn. ', '1230051', '2020-03-24'),
(9, '17079291', '1234004', 'Phản hồi điểm danh sai ngày  2019-09-30', 'Thưa thầy, ngày 2019-09-30 em chỉ đi trễ. Nhưng trên hệ thống lại báo vắng không phép. Mong thầy kiểm tra lại giúp em. Em cảm ơn. ', '1230051', '2020-03-24');
